import React, { Component } from 'react'

export default class Child1 extends Component {


  render() {
    //  let pr= this.props.inncomingProduct
    // console.log(pr.price);
     let {id, name, category, price, stock, sale} = this.props.inncomingProduct;
     
    return (
      <div className='col-4 g-3'>
        <div className='bg-light text-start p-3' key={id}>
          <h4 className='display-6'>{name}</h4>
          <h4 className=''>{category}</h4>
          <h4 className=''><span className='display-6'>{price} </span>
            {sale?<span className='bg-danger h6 ms-2 p-1 text-white'>Sale</span>:""}
          </h4>
          <h4 className=''>Stock: <span className='display-8'>{stock}</span></h4>
        </div>
      </div>
    )
  }
}
